import React from "react";
import '../Components/Form.css'

function Form() {
  return (
    <div>
      <form>
        <input className="task" type="text" placeholder="Enter task.." />
        <input className="date" type="date" placeholder="Enter Deadline.." />
        <div className="btn">
          <button>Submit</button>
        </div>
      </form>
    </div>
  );
}

export default Form;
